import React from "react";
import { FaBars } from "react-icons/fa";
import { NavLink } from "react-router-dom";

function ProductStartReview() {
  return (
    <div className="grid place-content-center my-5 ">
      <div className="max-w-[30rem] w-full p-4">
        <div className="flex justify-end">
          <FaBars className="text-xl" />
        </div>
        <div className="-mt-28">
          {/* 
      ///////////Img & Subtitles////////
      ////////////////////////// */}
          <div className="flex flex-col justify-center items-center mt-28">
            <div className="max-w-[13rem] max-h-28">
              <img
                src="/images/productImage.svg"
                className="rounded-full max-w-full h-auto"
              />
            </div>
            <div className="flex flex-col justify-center items-center ">
              <p className="text-[#3B2B2F] text-3xl">DOJA - C99</p>
              <p className="text-sm text-[#191C1A]/70 font-normal">Sativa</p>
            </div>
          </div>
          {/* 
      ///////////Product Description////////
      ////////////////////////// */}
          <div>
            <p className="text-2xl text-[#3B2B2F] font-normal mb-1">THC/CBD</p>
            <p className="text-sm text-[#3B2B2F] font-normal">
              20.00 - 26.00% THC | 0.00 - 0.01% CBD
            </p>
            <p className="text-2xl font-normal text-[#3B2B2F]">AROMAS</p>
            <img src="/images/screenShot.svg" />
            <p className="text-2xl text-[#3B2B2F] font-normal mt-2">TERPENES</p>
            <p className="text-sm text-[#3B2B2F] font-normal">
              35% MYRCENE | 29% CARYOPHYLLENE |{" "}
            </p>
            <p className="text-sm text-[#3B2B2F] font-normal"> 18% PINENE</p>
            <p className="text-2xl text-[#3B2B2F] mt-2">Description</p>
            <p className="w-full text-sm text-[#3B2B2F]">
              DOJA C99 is a THC potent sativa dominant strain with dense buds
              that deliver a combination of pine and citrus aromas and
              flavours.This flower is hang dried and hand-finished using
              techniques found in British Columbia's Okanagan Valley.{" "}
            </p>
          </div>
          {/* 
      ///////////Button////////
      ////////////////////////// */}
          <NavLink
            to={"../add-image"}
            type="button"
            className="mt-4 w-full py-3 bg-[#A7AE45] text-[#ffff] rounded-xl text-2xl font-bold font-family text-center cursor-pointer]"
          >
            Start Review
          </NavLink>
        </div>
      </div>
    </div>
  );
}

export default ProductStartReview;
